import React, { useEffect, useState } from "react";
import axios from "axios";
import "../styles/YourProjects.css";

export default function YourProjects() {
  const [userProjects, setUserProjects] = useState([]);
  const username = localStorage.getItem("username") || "guest";

  // Fetch all selected projects
  useEffect(() => {
    axios.get(`http://localhost:8080/api/projects/user/${username}`)
      .then(res => setUserProjects(res.data))
      .catch(err => console.error(err));
  }, [username]);

  return (
    <div className="page-container your-projects-container">
      <h2>Your Projects</h2>
      {userProjects.length === 0 && <p>No projects selected yet.</p>}

      {userProjects.map(up => (
        <div key={up.id} className="user-project-card">
          <p>Project ID: {up.projectId}</p>
          <p>Start: {new Date(up.startTime).toLocaleString()}</p>
          <p>End: {up.endTime ? new Date(up.endTime).toLocaleString() : "In progress"}</p>
          <p>Total Earned: ${up.totalAmount.toFixed(2)}</p>
        </div>
      ))}
    </div>
  );
}
